import ReactDOM from "react-dom/client";
// import App from "./components/App";
const root = ReactDOM.createRoot(document.getElementById('root'));
var count = 0
var increase= ()=>{
  count++
  // console.log(count++)
  root.render(
    <div className="container">
      <h1>{count}</h1>
      <button onClick={increase}>+</button>
    </div>
  );
}
root.render(
  <div className="container">
